# HTTP 代理端口
port: 7890

# SOCKS5 代理端口
socks-port: 7891

# Linux 和 macOS 的 redir 代理端口 (如需使用此功能，请取消注释)
# redir-port: 7892

# 允许局域网的连接（可用来共享代理）
allow-lan: false

# 规则模式：Rule（规则） / Global（全局代理）/ Direct（全局直连）
mode: Rule

# 设置日志输出级别 (默认级别：silent，即不输出任何内容，以避免因日志内容过大而导致程序内存溢出）。
# 5 个级别：silent / info / warning / error / debug。级别越高日志输出量越大，越倾向于调试，若需要请自行开启。
log-level: info

# clash 的 RESTful API
external-controller: 127.0.0.1:9090
# external-ui: "/home/king/clashrconf/dist"

# RESTful API 的口令 (可选)
# secret: ""

# DNS 设置
#dns:
#  enable: true
#  listen: 0.0.0.0:53
#  enhanced-mode: fake-ip
#  nameserver:
#   - 119.29.29.29
#   - 223.5.5.5

# Clash for Windows
cfw-bypass:
  - qq.com
  - music.163.com
  - '*.music.126.net'
  - localhost
  - 127.*
  - 10.*
  - 172.16.*
  - 172.17.*
  - 172.18.*
  - 172.19.*
  - 172.20.*
  - 172.21.*
  - 172.22.*
  - 172.23.*
  - 172.24.*
  - 172.25.*
  - 172.26.*
  - 172.27.*
  - 172.28.*
  - 172.29.*
  - 172.30.*
  - 172.31.*
  - 192.168.*
  - <local>
cfw-latency-timeout: 5000


Proxy:
- { name: "Unblock", type: neteasemusic, port: 31080, source: "migu:kuwo:kugou" }


Proxy Group:

- { name: "Proxy", type: select, proxies: ["DIRECT"] }
- { name: "NeteaseMusic", type: select, proxies: ["Unblock", "DIRECT"] }
- { name: "屏蔽网站", type: select, proxies: ["REJECT", "DIRECT"] }

